chrome.tabs.onUpdated.addListener((tabId, changeInfo, tab) => {
    if (changeInfo.status === "complete") {
        chrome.scripting.executeScript({
            target: { tabId: tabId },
            function: injectScript
        });
    }
});

function injectScript() {
    console.log("Injected JavaScript");
    document.body.style.backgroundColor = "black";
    document.body.style.color = "rgb(118,255,3)";

    /*
    document.body.insertAdjacentHTML("afterbegin", `<img src="data:image/png;base64,">`);

    */
    document.querySelector("body").style.padding = "10px";
    document.querySelector("body").style.border = "1px dashed rgb(255,0,153)";

    document.querySelectorAll("img")[0].remove();

    document.querySelector(".stream").insertAdjacentHTML("afterbegin", `
        <div id="img-container" style="height: 240px;">
            <canvas id="overlay" style="position: absolute; z-index: 1;">why are you not using chrome, idiot?</canvas>
            <img id="img" src="/stream.mjpg" style="height: calc(100% - 4px);">
        </div>
        `);
    document.body.insertAdjacentHTML("beforeend", "<canvas id='hidden-canvas' style='display: none; position: fixed;'></canvas>");
    document.querySelector(".stream").style.textAlign = "center";
    document.querySelector(".stream").insertAdjacentHTML("beforeend", `
        <button id='fs-btn' style='margin-bottom: 10px; font-size: 32px; padding: 10px; cursor: pointer; border: 1px solid rgb(255,0,153); color: rgb(118,255,3); background-color: black;'>FULLSCREEN</button>
        <br>
        <button id='defaults-btn' style='margin-bottom: 10px; font-size: 26px; padding: 8px; cursor: pointer; border: 1px solid rgb(255,0,153); color: rgb(118,255,3); background-color: black;'>Reset Configs</button>
        <br>
        <input id="align1" type="radio" name="align" value="Right" checked=""><label for="align1">Right</label>
        <input id="align2" type="radio" name="align" value="Top"><label for="align2">Top</label>
        <br>
        <label>Effect: </label>
        <select name="shader" id="shader">
            <option value="none">None</option>
            <option value="invert">Invert</option>
            <option value="red">Redscale</option>
            <option value="green">Greenscale</option>
            <option value="blue">Bluescale</option>
            <option value="grey">Greyscale</option>
            <option value="funky">Funky</option>
            <option value="sat">Saturated</option>
            <option value="black">Black</option>
            <option value="contrast">Contrast</option>
            <option value="reef">Reef</option>
        </select>
        <br>
        <label>Crosshair: </label>
        <select name="crosshair" id="crosshair">
            <option value="none">None</option>
            <option value="white">White</option>
            <option value="grey">Grey</option>
            <option value="black">Black</option>
            <option value="rgb(255,0,153)">Magenta</option>
            <option value="rgb(71, 143, 205)">Blue</option>
            <option value="rgb(118,255,3)">Green</option>
            <option value="rgb(247,235,18)">Yellow</option>
            <option value="invert-d">Invert (detailed)</option>
            <option value="invert-o">Invert (optimized)</option>
            <option value="invert-co">Invert (crazy optimized)</option>
        </select>
        <br>
        <label>Flip Image: </label>
        <input id="flip1" type="radio" name="flip" value="off" checked=""><label for="flip1">off</label>
        <input id="flip2" type="radio" name="flip" value="on"><label for="flip2">on</label>
        <br>
        `);

    document.getElementById("img").style.borderTop = "2px solid rgb(255,0,153)";
    document.getElementById("img").style.borderRight = "2px solid rgb(71, 143, 205)";
    document.getElementById("img").style.borderBottom = "2px solid rgb(118,255,3)";
    document.getElementById("img").style.borderLeft = "2px solid rgb(247,235,18)";

    document.getElementById("overlay").style.border = "2px solid rgba(0,0,0,0)";

    let isFullscreen = false;
    let alignment = "right";

    document.querySelector("head").insertAdjacentHTML("beforeend", `
        <style>
            a {
                color: rgb(71, 143, 205);
            }
            input[type="range"] {
                accent-color: rgb(71, 143, 205);
            }
        </style>
        `);

    function setSetting(id, val) {
        let el = document.getElementById(id);
        el.value = val;
        el.dispatchEvent(new Event('input'));
    }

    function setDefaults() {
        setSetting("brightness", 100);
        setSetting("contrast", 100);
        setSetting("saturation", 100);
        setSetting("hue", 60);
        setSetting("gamma", 95);
        setSetting("gain", 0);
        document.getElementById("power_line_frequency1").checked = "false";
        document.getElementById("power_line_frequency2").checked = "true";
        document.getElementById("power_line_frequency2").dispatchEvent(new Event('click'));
        document.getElementById("white_balance_temperature_auto").checked = "false";
        document.getElementById("white_balance_temperature_auto").dispatchEvent(new Event('click'));
        setSetting("white_balance_temperature", 3300);
        setSetting("sharpness", 5);
    }

    // Invert a pixel's color
    function invertColor(r, g, b) {
        return [255 - r, 255 - g, 255 - b];
    }
    function shader(r, g, b, data, index, width) {
        let pixel;
        switch (document.getElementById("shader").value) {
            case "invert": //invert
                pixel = invertColor(r, g, b);
                break;

            case "grey": //grey
                pixel = [(r + g + b)/3,(r + g + b)/3,(r + g + b)/3];
                break;

            case "red": //redscale
                pixel = [r, 0, 0];
                break;

            case "green": //greenscale
                pixel = [0, g, 0];
                break;

            case "blue": //bluescale
                pixel = [0, 0, b];
                break;

            case "funky": //funky
                pixel = [Math.min(Math.random() * b + g, 255), Math.min(Math.random() * r + b, 255), Math.min(Math.random() * g + r, 255)];
                break;

            case "sat": //saturated
                pixel = [Math.min(r * 2, 255), Math.min(g * 2, 255), Math.min(b * 2, 255)];
                break;

            case "black": //saturated
                if (r < 50 && g < 50 && b < 50 && r+g+b < 100) {
                    pixel = [Math.min(r * 10, 255), Math.min(g * 10, 255), Math.min(b * 10, 255)]
                } else {
                    pixel = [Math.min(r * 0.2, 255), Math.min(g * 0.2, 255), Math.min(b * 0.2, 255)];
                }
                break;

            case "contrast": //contrast
                if ((r+g+b)/3 > 110) {
                    pixel = [Math.min(r * 1.7, 255), Math.min(g * 1.7, 255), Math.min(b * 1.7, 255)];
                } else {
                    pixel = [Math.min(r * 0.2, 255), Math.min(g * 0.2, 255), Math.min(b * 0.2, 255)];
                }
                break;

            case "reef": //reef
                if (g < (r+b)/2 && g < 160) {
                    pixel = [255, 0, 255];
                } else {
                    pixel = [0, 0, 0, 0];
                }
                break;

            default:
                pixel = [r, g, b];
        }
        return (pixel.length == 3) ? [pixel[0],pixel[1],pixel[2],1]:pixel;
    }

    let overlay = document.getElementById("overlay");
    let ctx = overlay.getContext("2d");

    let hiddenCanvas = document.getElementById("hidden-canvas");
    let hiddenCtx = hiddenCanvas.getContext("2d", {
        willReadFrequently: true
    });

    let img = document.getElementById("img");

    function drawLine(x1, y1, x2, y2, width, frameData, ctx, img) {
        let coFactor = 3;
        x1 = Math.floor(x1);
        x2 = Math.floor(x2);
        y1 = Math.floor(y1);
        y2 = Math.floor(y2);
        if (document.getElementById("crosshair").value.endsWith("-o")) {
            if (y1 == y2) {
                let y = y1+Math.floor((1 - width)*0.5);
                for (let x = x1; x < x2; (x1 < x2) ? x++:x--) {
                    const index = (y * img.width + x) * 4;
        
                    // Extract and invert pixel color
                    const [r, g, b] = invertColor(
                        frameData.data[index],
                        frameData.data[index + 1],
                        frameData.data[index + 2]
                    );
        
                    // Draw the inverted pixel
                    ctx.fillStyle = `rgb(${r}, ${g}, ${b})`;
                    ctx.fillRect(x, y, 1, width-1);
                }
            } else if (x1 == x2) {
                let x = x1+Math.floor((1 - width)*0.5);
                for (let y = y1; y < y2; (y1 < y2) ? y++:y--) {
                    const index = (y * img.width + x) * 4;
        
                    // Extract and invert pixel color
                    const [r, g, b] = invertColor(
                        frameData.data[index],
                        frameData.data[index + 1],
                        frameData.data[index + 2]
                    );
        
                    // Draw the inverted pixel
                    ctx.fillStyle = `rgb(${r}, ${g}, ${b})`;
                    ctx.fillRect(x, y, width, 1);
                }
            }
        } else if (document.getElementById("crosshair").value.endsWith("-d")) {
            if (y1 == y2) {
                for (let i = Math.floor((1 - width)*0.5); i < Math.floor((width - 1)*0.5); i++) {
                    let y = y1+i;
                    for (let x = x1; x < x2; (x1 < x2) ? x++:x--) {
                        const index = (y * img.width + x) * 4;
            
                        // Extract and invert pixel color
                        const [r, g, b] = invertColor(
                            frameData.data[index],
                            frameData.data[index + 1],
                            frameData.data[index + 2]
                        );
            
                        // Draw the inverted pixel
                        ctx.fillStyle = `rgb(${r}, ${g}, ${b})`;
                        ctx.fillRect(x, y, 1, 1);
                    }
                }
            } else if (x1 == x2) {
                for (let i = Math.floor((1 - width)*0.5); i < Math.floor((width - 1)*0.5); i++) {
                    let x = x1+i;
                    for (let y = y1; y < y2; (y1 < y2) ? y++:y--) {
                        const index = (y * img.width + x) * 4;
            
                        // Extract and invert pixel color
                        const [r, g, b] = invertColor(
                            frameData.data[index],
                            frameData.data[index + 1],
                            frameData.data[index + 2]
                        );
            
                        // Draw the inverted pixel
                        ctx.fillStyle = `rgb(${r}, ${g}, ${b})`;
                        ctx.fillRect(x, y, 1, 1);
                    }
                }
            }
        } else if (document.getElementById("crosshair").value.endsWith("-co")) {
            if (y1 == y2) {
                let y = y1+Math.floor((1 - width)*0.5);
                for (let x = Math.floor(x1/coFactor)*coFactor; x < Math.floor(x2/coFactor)*coFactor; (x1 < x2) ? x+=2:x-=2) {
                    const index = (y * img.width + x) * 4;
        
                    // Extract and invert pixel color
                    const [r, g, b] = invertColor(
                        frameData.data[index],
                        frameData.data[index + 1],
                        frameData.data[index + 2]
                    );
        
                    // Draw the inverted pixel
                    ctx.fillStyle = `rgb(${r}, ${g}, ${b})`;
                    ctx.fillRect(x, y, coFactor, width-1);
                }
            } else if (x1 == x2) {
                let x = x1+Math.floor((1 - width)*0.5);
                for (let y = Math.floor(y1/coFactor)*coFactor; y < Math.floor(y2/coFactor)*coFactor; (y1 < y2) ? y+=2:y-=2) {
                    const index = (y * img.width + x) * 4;
        
                    // Extract and invert pixel color
                    const [r, g, b] = invertColor(
                        frameData.data[index],
                        frameData.data[index + 1],
                        frameData.data[index + 2]
                    );
        
                    // Draw the inverted pixel
                    ctx.fillStyle = `rgb(${r}, ${g}, ${b})`;
                    ctx.fillRect(x, y, width, coFactor);
                }
            }
        }
    }

    function screenEffect(frameData, ctx, img) {
        let width = 320;
        let height = 240;
        if (document.getElementById("shader").value == "reef") {
            width = width/2;
            height = height/2;
        }
        for (let x = 0; x < width; x++) {
            for (let y = 0; y < height; y++) {
                const index = (Math.round(y * img.width/width) * img.width + Math.round(x * img.width/width)) * 4;

                // Extract and invert pixel color
                const [r, g, b, a] = shader(
                    frameData.data[index],
                    frameData.data[index + 1],
                    frameData.data[index + 2],
                    frameData.data,
                    index,
                    img.width
                );

                // Draw the inverted pixel
                if (a > 0) {
                    ctx.fillStyle = `rgba(${r}, ${g}, ${b}, ${a})`;
                    ctx.fillRect(x * img.width/width, y * img.height/height, img.width/width, img.height/height);
                }
            }
        }
    }

    // Process frame and draw inverted pixels along lines
    function render() {

        let crosshairSize = 30;
        let crosshairThickness = 7;
        let dashThickness = 5;
        let spread = overlay.width / 10;
        let dashes = 17;

        overlay.style.width = img.width + "px";
        overlay.style.height = img.height + "px";
        overlay.width = img.width;
        overlay.height = img.height;

        // Clear the visible canvas
        ctx.clearRect(0, 0, overlay.width, overlay.height);

        let frameData = null;

        if (document.getElementById("shader").value != "none") {
            // Draw video frame to a hidden canvas to capture pixel data
            if (frameData == null) {
                hiddenCanvas.width = img.width;
                hiddenCanvas.height = img.height;
                hiddenCtx.drawImage(img, 0, 0, img.width, img.height);
                frameData = hiddenCtx.getImageData(0, 0, img.width, img.height);
            }
            screenEffect(frameData, ctx, img);
        }

        if (document.getElementById("crosshair").value.startsWith("invert")) {
            // Draw video frame to a hidden canvas to capture pixel data
            if (frameData == null) {
                hiddenCanvas.width = img.width;
                hiddenCanvas.height = img.height;
                hiddenCtx.drawImage(img, 0, 0, img.width, img.height);
                frameData = hiddenCtx.getImageData(0, 0, img.width, img.height);
            }

            drawLine(overlay.width/2, overlay.height/2 - crosshairSize, overlay.width/2, overlay.height/2 - 3, crosshairThickness, frameData, ctx, img);
            drawLine(overlay.width/2, overlay.height/2 + 3 , overlay.width/2, overlay.height/2 + crosshairSize, crosshairThickness, frameData, ctx, img);
            
            drawLine(overlay.width/2 - crosshairSize, overlay.height/2, overlay.width/2 + crosshairSize, overlay.height/2, crosshairThickness, frameData, ctx, img);

            for (let i = 0; i < dashes; i+=2) {
                drawLine(overlay.width/2 + spread, Math.floor(overlay.height / dashes * i), overlay.width/2 + spread, Math.floor(overlay.height / dashes * (i+1)), dashThickness, frameData, ctx, img);
            }
            for (let i = 0; i < dashes; i+=2) {
                drawLine(overlay.width/2 - spread, Math.floor(overlay.height / dashes * i), overlay.width/2 - spread, Math.floor(overlay.height / dashes * (i+1)), dashThickness, frameData, ctx, img);
            }
        } else if (document.getElementById("crosshair").value != "none") {

            ctx.strokeStyle = document.getElementById("crosshair").value;
            ctx.lineWidth = crosshairThickness;

            ctx.moveTo(overlay.width/2, overlay.height/2 - crosshairSize);
            ctx.lineTo(overlay.width/2, overlay.height/2 - 1);

            ctx.moveTo(overlay.width/2, overlay.height/2 + 1);
            ctx.lineTo(overlay.width/2, overlay.height/2 + crosshairSize);

            ctx.moveTo(overlay.width/2 - crosshairSize, overlay.height/2);
            ctx.lineTo(overlay.width/2 + crosshairSize, overlay.height/2);

            ctx.stroke();

            ctx.lineWidth = dashThickness;

            for (let i = 0; i < dashes; i+=2) {
                ctx.moveTo(overlay.width/2 + spread, Math.floor(overlay.height / dashes * i));
                ctx.lineTo(overlay.width/2 + spread, Math.floor(overlay.height / dashes * (i+1)));
            }

            for (let i = 0; i < dashes; i+=2) {
                ctx.moveTo(overlay.width/2 - spread, Math.floor(overlay.height / dashes * i));
                ctx.lineTo(overlay.width/2 - spread, Math.floor(overlay.height / dashes * (i+1)));
            }

            ctx.stroke();
        }

        // Repeat for the next frame
        requestAnimationFrame(render);
    }
    
    if (document.querySelector("#saturation").value == 50) {
        setDefaults();
    }

    document.getElementById("fs-btn").addEventListener("click", (e) => {
        document.getElementById("img-container").requestFullscreen();
    });

    document.getElementById("align1").addEventListener("click", (e) => {
        alignment = "right";
        img.style.height = "calc(100% - 4px)";
        img.style.width = "";
    });

    document.getElementById("align2").addEventListener("click", (e) => {
        alignment = "top";
        img.style.height = "";
        img.style.width = "calc(100% - 4px)";
    });

    document.getElementById("flip1").addEventListener("click", (e) => {
        img.style.transform = "scaleY(1)";
    });

    document.getElementById("flip2").addEventListener("click", (e) => {
        img.style.transform = "scaleY(-1)";
    });

    document.addEventListener("fullscreenchange", (e) => {
        isFullscreen = !isFullscreen;
        if (isFullscreen) {
            img.style.position = "absolute";
            if (alignment == "right") {
                overlay.style.right = "0";
                overlay.style.top = "";
                img.style.right = "0";
                img.style.top = "";
            } else {
                overlay.style.right = "";
                overlay.style.left = "0";
                overlay.style.top = "0";
                img.style.right = "";
                img.style.left = "0";
                img.style.top = "0";
            }
        } else {
            console.log("sig");
            img.style.position = "";
            overlay.style.right = "";
            overlay.style.left = "";
            overlay.style.top = "";
            img.style.right = "";
            img.style.left = "";
            img.style.top = "";
        }
    });

    document.getElementById("defaults-btn").addEventListener("click", (e) => {
        setDefaults();
    });

    setTimeout(() => {
        render();
    }, 1000);
}